import axios from 'axios'
// import { config as dotenv } from 'dotenv'


export default class Api {

    constructor() {
        axios.create({
            baseURL: `http://localhost:5000`,
            headers: {
                "Content-type": "application/json"
            }
        })
    }

    index = async () => {
        const res = await axios.get('http://localhost:5000/index')
        if (res) {
            const { data } = res
            console.log(data[0])
        }
    }
}
